CREATE DEFINER=`c1880898`@`%` PROCEDURE `busca_comprobantes` (IN `opc` TINYINT, IN `opc_comprobante` TINYINT, IN `fecha1` DATE, IN `fecha2` DATE, IN `nro_compro` BIGINT)  NO SQL
IF opc = 1 AND opc_comprobante = 1 THEN
SELECT clientes.razon,
		clientes.nombre,
        LPAD (facturas_emitidas.nro_comprobante, 8, '0') as nro_comprobante,
        facturas_emitidas.fecha,
        tipo_factura.tipo_factura,
        facturas_emitidas.importe,
        facturas_emitidas.iva,
        opc_cobro.opc_cobro_pago,
        tipo_pago.tipo_pago,
        facturas_emitidas.saldo,
        facturas_emitidas.observaciones

FROM facturas_emitidas LEFT JOIN clientes
ON facturas_emitidas.id_cliente = clientes.id_cliente LEFT JOIN tipo_factura
ON facturas_emitidas.id_tipo = tipo_factura.id_tipo LEFT JOIN opc_cobro
ON facturas_emitidas.id_opc_pago = opc_cobro.id_opc LEFT JOIN tipo_pago
ON facturas_emitidas.id_opc = tipo_pago.id_tipo_pago
WHERE facturas_emitidas.fecha BETWEEN fecha1 AND fecha2
ORDER BY facturas_emitidas.fecha DESC;

ELSEIF (opc = 1 AND opc_comprobante = 2) THEN
SELECT clientes.razon,
		clientes.nombre,
        LPAD (facturas_recibidas.nro_comprobante, 8, '0') as nro_comprobante,
        facturas_recibidas.fecha,
        tipo_factura.tipo_factura,
        facturas_recibidas.importe,
        facturas_recibidas.iva,
        opc_cobro.opc_cobro_pago,
        facturas_recibidas.observaciones

FROM facturas_recibidas LEFT JOIN clientes
ON facturas_recibidas.id_cliente = clientes.id_cliente LEFT JOIN tipo_factura
ON facturas_recibidas.id_tipo = tipo_factura.id_tipo LEFT JOIN opc_cobro
ON facturas_recibidas.id_opc = opc_cobro.id_opc
WHERE facturas_recibidas.fecha BETWEEN fecha1 AND fecha2
ORDER BY facturas_recibidas.fecha DESC;

ELSEIF (opc = 1 AND opc_comprobante = 3) THEN
SELECT cheques_emitidos.nro_cheque,
		bancos.nombre_banco,
        cheques_emitidos.fecha_emision,
        cheques_emitidos.fecha_pago,
        cheques_emitidos.importe,
        cheques_emitidos.destinatario,
        cheques_emitidos.observaciones

FROM cheques_emitidos JOIN bancos
ON cheques_emitidos.banco = bancos.id_banco
WHERE cheques_emitidos.fecha_emision BETWEEN fecha1 AND fecha2
ORDER BY cheques_emitidos.fecha_emision DESC;

ELSEIF (opc = 1 AND opc_comprobante = 4) THEN
SELECT nota_credito.id_nota,
		nota_credito.fecha,
		nota_credito.importe,
        tipo.detalle,
        nota_credito.observaciones
FROM nota_credito LEFT JOIN tipo
ON nota_credito.tipo = tipo.id_tipo_ingreso_egreso
WHERE nota_credito.fecha BETWEEN fecha1 AND fecha2
ORDER BY nota_credito.fecha DESC;

ELSEIF (opc = 2 AND opc_comprobante = 1) THEN
SELECT clientes.razon,
		clientes.nombre,
        LPAD (facturas_emitidas.nro_comprobante, 8, '0') as nro_comprobante,
        facturas_emitidas.fecha,
        tipo_factura.tipo_factura,
        facturas_emitidas.importe,
        facturas_emitidas.iva,
        opc_cobro.opc_cobro_pago,
        tipo_pago.tipo_pago,
        facturas_emitidas.saldo,
        facturas_emitidas.observaciones

FROM facturas_emitidas LEFT JOIN clientes
ON facturas_emitidas.id_cliente = clientes.id_cliente LEFT JOIN tipo_factura
ON facturas_emitidas.id_tipo = tipo_factura.id_tipo LEFT JOIN opc_cobro
ON facturas_emitidas.id_opc_pago = opc_cobro.id_opc LEFT JOIN tipo_pago
ON facturas_emitidas.id_opc = tipo_pago.id_tipo_pago
WHERE facturas_emitidas.nro_comprobante = nro_compro
ORDER BY facturas_emitidas.fecha DESC;

ELSEIF (opc = 2 AND opc_comprobante = 2) THEN
SELECT clientes.razon,
		clientes.nombre,
        LPAD (facturas_recibidas.nro_comprobante, 8, '0') as nro_comprobante,
        facturas_recibidas.fecha,
        tipo_factura.tipo_factura,
        facturas_recibidas.importe,
        facturas_recibidas.iva,
        opc_cobro.opc_cobro_pago,
        facturas_recibidas.observaciones

FROM facturas_recibidas LEFT JOIN clientes
ON facturas_recibidas.id_cliente = clientes.id_cliente LEFT JOIN tipo_factura
ON facturas_recibidas.id_tipo = tipo_factura.id_tipo LEFT JOIN opc_cobro
ON facturas_recibidas.id_opc = opc_cobro.id_opc
WHERE facturas_recibidas.nro_comprobante = nro_compro
ORDER BY facturas_recibidas.fecha DESC;

ELSEIF (opc = 2 AND opc_comprobante = 3) THEN
SELECT cheques_emitidos.nro_cheque,
		bancos.nombre_banco,
        cheques_emitidos.fecha_emision,
        cheques_emitidos.fecha_pago,
        cheques_emitidos.importe,
        cheques_emitidos.destinatario,
        cheques_emitidos.observaciones

FROM cheques_emitidos JOIN bancos
ON cheques_emitidos.banco = bancos.id_banco
WHERE cheques_emitidos.nro_cheque = nro_compro
ORDER BY cheques_emitidos.fecha_emision DESC;

ELSEIF (opc = 2 AND opc_comprobante = 4) THEN
SELECT nota_credito.id_nota,
		nota_credito.fecha,
		nota_credito.importe,
        tipo.detalle,
        nota_credito.observaciones
FROM nota_credito LEFT JOIN tipo
ON nota_credito.tipo = tipo.id_tipo_ingreso_egreso
WHERE id_nota = nro_compro
ORDER BY nota_credito.fecha DESC;
END IF$$

