CREATE DEFINER=`c1880898`@`%` PROCEDURE `busca_estado_caja` (IN `fecha1` DATE, IN `fecha2` DATE)  NO SQL
BEGIN
DECLARE facturado DECIMAL(11,2) DEFAULT 0;
DECLARE ivas DECIMAL(9,2) DEFAULT 0;
DECLARE cargas1 DECIMAL(9,2) DEFAULT 0;
DECLARE cargas2 DECIMAL(9,2) DEFAULT 0;
DECLARE cargas3 DECIMAL(9,2) DEFAULT 0;
SET facturado = (SELECT SUM(importe) FROM facturas_emitidas WHERE fecha BETWEEN fecha1 AND fecha2);
SET ivas = (SELECT SUM(iva) FROM facturas_emitidas WHERE fecha BETWEEN fecha1 AND fecha2);
SET cargas1 = (SELECT SUM(carga1) FROM caja WHERE fecha_ingreso BETWEEN fecha1 AND fecha2);
SET cargas2 = (SELECT SUM(carga2) FROM caja WHERE fecha_ingreso BETWEEN fecha1 AND fecha2);
SET cargas3 = (SELECT SUM(carga3) FROM caja WHERE fecha_ingreso BETWEEN fecha1 AND fecha2);

SELECT facturado as Facturado,
        ivas as Iva,
        facturado + ivas as Total,
        SUM(cobrado) as Ganancias,
        cargas1,
        cargas2,
        cargas3,
        cargas1 + cargas2 + cargas3 as total_carga,
        (facturado + ivas) - SUM(cobrado) as Saldos
FROM `caja`
WHERE fecha_ingreso BETWEEN fecha1 AND fecha2;END$$

