CREATE DEFINER=`c1880898`@`%` PROCEDURE `elimina_caja` (IN `tipo_comprobante` TINYINT(1), IN `id_caja_param` INT, IN `id_factura` INT)  NO SQL
BEGIN
	DECLARE cobrado_var DECIMAL(11,2) DEFAULT 0;
    DECLARE pagado_var DECIMAL(11,2) DEFAULT 0;
    DECLARE id_cheq int DEFAULT 0;

SET id_cheq = (SELECT id_cheque FROM caja
WHERE id_caja = id_caja_param);
    
IF tipo_comprobante = 1 THEN
SET cobrado_var = (SELECT cobrado FROM caja
WHERE id_caja = id_caja_param);

DELETE FROM caja WHERE id_caja = id_caja_param;

UPDATE facturas_emitidas
SET saldo = saldo + cobrado_var,
	id_opc_pago = 0,
	id_opc = 0
WHERE id_factura_emitida = id_factura;

ELSEIF (tipo_comprobante = 2) THEN
SET pagado_var = (SELECT pagado FROM caja
WHERE id_caja = id_caja_param);

DELETE FROM caja WHERE id_caja = id_caja_param;

UPDATE facturas_recibidas
SET subtotal = subtotal + pagado_var, pagado = 0
WHERE id_factura_recibida = id_factura;
END IF;

IF (id_cheq > 0) THEN
UPDATE cheques_emitidos
SET utilizado = 0
WHERE id_cheque = id_cheq;
END IF;
END$$

