CREATE DEFINER=`c1880898`@`%` PROCEDURE `prueba_caja` (IN `tipo_comprobante` TINYINT, IN `id_comprobante` INT)  BEGIN
    DECLARE total DECIMAL(11,2) DEFAULT 0;

	IF tipo_comprobante = 1 THEN
    SET total =  (SELECT importe + iva FROM facturas_emitidas WHERE id_factura_emitida = id_comprobante);

    ELSEIF (tipo_comprobante = 2) THEN
    SET total = (SELECT importe + iva FROM facturas_recibidas WHERE id_factura_recibida = id_comprobante);

    ELSEIF (tipo_comprobante = 3) THEN
    SET total = (SELECT importe FROM cheques_emitidos WHERE id_cheque = id_comprobante);

    ELSEIF (tipo_comprobante = 4) THEN
    SET total = (SELECT importe FROM nota_credito WHERE id_nota = id_comprobante);
    END IF;

    SELECT total;
END$$

