select caja.id_caja,
		caja.fecha_ingreso,
        datediff(now(),fecha_ingreso) as Diff,
		concat(empleados.apellido, ", ", empleados.nombre) as usuario,
        caja.id_cliente,
        clientes.razon,
        caja.id_tipo_factura,
        caja.id_factura,
        case when caja.id_tipo_factura = 1 then (select facturas_emitidas.nro_comprobante from facturas_emitidas where id_factura_emitida = caja.id_factura)
        		when caja.id_tipo_factura = 2 then (select facturas_recibidas.nro_comprobante from facturas_recibidas where id_factura_recibida = caja.id_factura) end as comprobante,
        caja.facturado as TOTAL,
        caja.cobrado,
        caja.pagado,
        case when caja.id_tipo_factura = 1 then (select facturas_emitidas.saldo from facturas_emitidas where id_factura_emitida = caja.id_factura)
        		when caja.id_tipo_factura = 2 then (select facturas_recibidas.subtotal from facturas_recibidas where id_factura_recibida = caja.id_factura) end as saldo,
        caja.medio,
        caja.carga1,
        caja.carga2,
        caja.carga3,
        caja.carga4,
        caja.carga5,
        caja.carga1 + caja.carga2 + caja.carga3 + caja.carga4 + caja.carga5 as total_cargas,
        caja.observaciones,
        case when caja.confirmacion = 0 then 'Sin Confirmar'
        		when caja.confirmacion = 1 then 'Confirmado'
                when caja.confirmacion = 2 then 'No Confirmado'end as confirmacion

from caja join clientes
on caja.id_cliente = clientes.id_cliente join empleados
on caja.id_empleado = empleados.id_empleado
where caja.fecha_ingreso BETWEEN fecha_busca AND DATE_ADD(fecha_busca, interval 1 month)
order by caja.fecha_ingreso DESC$$

CREATE DEFINER=`c1880898`@`%` PROCEDURE `select_caja_chica` (IN `fecha_busca` VARCHAR(8))  NO SQL
select caja_chica.id_caja,
concat(empleados.apellido, ", ", empleados.nombre) as usuario,
caja_chica.fecha,
caja_chica.importe_ingresado,
