caja_chica.nro_factura,
caja_chica.medio,
caja_chica.observaciones,
caja_chica.saldo,
caja_chica.confirmacion

from caja_chica join empleados
on caja_chica.id_usuario = empleados.id_empleado
where caja_chica.fecha >= fecha_busca
order by caja_chica.fecha desc$$

