CREATE DEFINER=`c1880898`@`%` PROCEDURE `select_comprobante` (IN `id_compro` INT)  NO SQL
IF id_compro = 1 THEN
SELECT facturas_emitidas.id_factura_emitida AS id_comprobante,
		facturas_emitidas.nro_comprobante AS detalle,
        clientes.razon,
        facturas_emitidas.fecha,
        facturas_emitidas.saldo
FROM facturas_emitidas LEFT JOIN clientes
ON facturas_emitidas.id_cliente = clientes.id_cliente
WHERE saldo > 0
ORDER BY fecha DESC;

ELSEIF (id_compro = 2) THEN
SELECT facturas_recibidas.id_factura_recibida AS id_comprobante,
		facturas_recibidas.nro_comprobante AS detalle,
        clientes.razon,
        facturas_recibidas.fecha,
        facturas_recibidas.subtotal AS saldo
FROM facturas_recibidas LEFT JOIN clientes
ON facturas_recibidas.id_cliente = clientes.id_cliente
WHERE pagado = 0 OR pagado is null OR subtotal > 0
ORDER BY fecha DESC;

ELSEIF (id_compro = 3) THEN
SELECT id_cheque AS id_comprobante,
		nro_cheque AS detalle,
        destinatario,
        fecha_emision as fecha,
        importe
FROM cheques_emitidos
ORDER BY fecha_emision DESC;

ELSEIF (id_compro = 4) THEN
SELECT id_nota AS id_comprobante,
		fecha,
		observaciones AS detalle,
        importe
FROM nota_credito
ORDER BY fecha DESC;
END IF$$

CREATE DEFINER=`c1880898`@`%` PROCEDURE `select_comprobante_datos` (IN `id_tipo` TINYINT, IN `id_compro` INT)  NO SQL
IF id_tipo = 1 THEN
SELECT importe,
		id_cliente,
                iva,
		importe + iva as total
FROM facturas_emitidas
WHERE id_factura_emitida = id_compro;

ELSEIF (id_tipo = 2) THEN
SELECT importe,
		id_cliente,
                iva,
		importe + iva as total
FROM facturas_recibidas
WHERE id_factura_recibida = id_compro;

ELSEIF (id_tipo = 3) THEN
SELECT importe,
                destinatario as id_cliente,
		0 as iva,
		importe as total
FROM cheques_emitidos
WHERE id_cheque = id_compro;

ELSEIF (id_tipo = 4) THEN
SELECT importe,
		observaciones as id_cliente,
                0 as iva,
		importe as total
FROM nota_credito
WHERE id_nota = id_compro;
END IF$$

