order by left(convert(fecha_ingreso, date),7) desc$$

CREATE DEFINER=`c1880898`@`%` PROCEDURE `select_notas` ()  NO SQL
SELECT a.id_nota,
		a.fecha,
        a.importe,
		b.razon,
        a.observaciones,
        a.fecha_factura,
        a.fecha_pago,
        a.importe_factura,
        a.iva,
        LPAD (a.nro_factura, 8, '0') as nro_factura

FROM nota_credito AS a JOIN clientes AS b
WHERE a.id_cliente = b.id_cliente
ORDER BY a.id_nota DESC$$

CREATE DEFINER=`c1880898`@`%` PROCEDURE `select_relacion_admin` ()  NO SQL
SELECT relacion_administradores.id_admi,
		clientes.razon as Administrador,
		clientes.abono,
        relacion_administradores.id_clientes,
		(SELECT clientes.razon FROM clientes WHERE clientes.id_cliente = relacion_administradores.id_clientes) AS Cliente

FROM relacion_administradores JOIN clientes
ON relacion_administradores.id_admi = clientes.id_cliente
ORDER BY clientes.razon, Cliente$$

